import {
  FaChebronDown,
  FaInbox,
  FaRegCalendarAlt,
  FaRegCalendar,
} from "react-icons/fa";

export const Sidebar = () => (
  <div className="sidebar" data-testid="sidebar">
    <ul className="sidebar__generic">
      <li>Inbox</li>
      <li>Today</li>
      <li>Next 7 days</li>
    </ul>
  </div>
);
